import React from 'react';
import './App.css';
// import Home from './eleve/Home';
function App1(a,b){
  function afficher(){
    return a+b
  }
  return(
    <div className='App'>
      <div>Hello {afficher(2,)}</div>
    </div>
  )
}
export default App1
